import React, { usetState, useEffect } from "react";
import {
  Button,
  Form as FormStrap,
  FormGroup,
  Label,
  Input,
  FormText
} from "reactstrap";

function Form(props) {
  return (
    <FormStrap>
      <FormGroup>
        <Label for="name">Name</Label>
        <Input id="name" type="text" />
      </FormGroup>
    </FormStrap>
  );
}

export default Form;
